import React,
      { Component } from 'react';
import { Link } from 'react-router-dom';

import Header                   from './../../components/Header';
import Footer                   from './../../components/Footer';
import CoverPage                from './../../components/CoverPage/TitleText';
import FormContact              from './../../components/Contents/FormContact';

class Contact extends Component {
  render() {
    return (
      <div>

        <Header />

        <CoverPage
          title="Fale Conosco" />

        <div className="bg-colored">

          <FormContact />

          <div data-line-or-separate-contact>
            <p>OU</p>
          </div>

          <div data-suggest-faq>
            <p>
              Veja se sua duvida ja nao foi respondida nas <b>perguntas frquentes</b>
            </p>
            <button data-colored="big">Perguntas Frequentes</button>
          </div>

        </div>

        <Footer />

      </div>
    );
  }
}
export default Contact;
